import React, { createContext } from "react";
import MainContent from "./MainContent";
import { useParams } from "react-router-dom";
export const EditExamContext = createContext();
const EditExam = () => {
  const { examId } = useParams();
  const text = {
    header: "Exam-Topic-Mapping",
    btnText: "Topic to Exam ",
  };
  return (
    <EditExamContext.Provider value={{examId}}>
      <MainContent
        text={text}
        to="Topic to Exam"
        back={`/admin/exam/edit/examId/${examId}`}
      />
      <div className="border mt-2">
      <table class="table">
        <thead>
          <tr>
            <th scope="col">Exam Id</th>
            <th scope="col">Topic Id</th>
            <th scope="col">Percentage</th>
            <th scope="col">Topic Pass Percentage</th>
            <th scope="col">Question Per Exam</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">{examId}</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
            <td>@twitter</td>
          </tr>
          <tr>
            <th scope="row">{examId}</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
            <td>@twitter</td>
          </tr>
          <tr>
            <th scope="row">{examId}</th>
            <td colspan="2">Larry the Bird</td>
            <td>@twitter</td>
            <td>@twitter</td>
          </tr>
          
        </tbody>
      </table>
      </div>
    </EditExamContext.Provider>
  );
};

export default EditExam;
